import React from 'react';

export default function User({ firstname, lastname, age, myFirstName }) {
  return (
    <div>
      {firstname === myFirstName && <p>NKJNJKNKJ</p>}
      <p>Name: {firstname} {lastname}</p>
      {
        age >= 30
          ? <p>Age: {age}. Dear {firstname} {lastname} is old enough</p>
          : <p>Age is below 30. {firstname} is {age} years old</p>
      }
      <br />
    </div>
  );
}
